function Description({ descriptions })
{
    return(
        <div className="row">
           <div class="col profile-pics">
                <div className="row">
                    <img src={descriptions.photo} style={{width: 80,}}/>
                </div>
            </div>

            <div class="col descriptions">
                <div className="row">
                    <h2>{descriptions.name}</h2>
                    <p>{descriptions.description}</p>
                </div>
            </div>

            
        </div>
    );
}

export default Description
